import React from "react";
import {
  AiFillGithub,
  AiFillSetting,
  AiFillQuestionCircle,
} from "react-icons/ai";

const NavBar = () => {
  return (
    <div
      className="top-0 left-0 w-full h-14 m-0 
    flex flex-row justify-between items-center bg-gray-700 text-white shadow-md"
    >
      <h1 className="ml-4 text-yellow-500">Guessipedia</h1>
      <NavBarIcons />
    </div>
  );
};

const NavBarIcons = () => {
  return (
    <div
      className="top-0 left-0 w-full h-10 m-0 
      flex flex-row justify-end items-center bg-gray-700 text-white "
    >
      <Icon icon={<AiFillSetting size="24" />} href="/*" />
      <Icon icon={<AiFillQuestionCircle size="24" href="/*" />} />
      <Icon icon={<AiFillGithub size="24" />} href="http://github.com" />
    </div>
  );
};

const Icon = ({ icon, href }) => {
  return (
    <a href={href} className="sidebar-icon mx-2">
      {icon}
    </a>
  );
};

export default NavBar;
